import React, { Component } from "react";
import './App.scss';
import {
    Route,
    NavLink,
    BrowserRouter
} from "react-router-dom";
import Home from "./Home";
import About from "./About";
import Overview from "./Overview";
import Demo from "./Demo";
import Contact from "./Contact";
import logo from './images/Logo/YMP small logo no bg.png';
import 'bootstrap/dist/css/bootstrap.min.css';
import {
    Container, Row, Col, Navbar, Nav, NavDropdown
} from 'react-bootstrap';
// import { Navbar, Nav, } from 'react-bootstrap';

class Header extends Component {
    render() {
        return (
            <BrowserRouter>
                <div className="App-header">
                    <Container>
                        <Row>
                            <Col>
                                {/* <NavLink to="/">
                                    <img src={logo} className="App-header-logo" alt="logo" />
                                    <span className="App-header-text">yacht maintenance program</span>
                                </NavLink>
                                <ul className="App-header-menu">
                                    <li><NavLink to="/">Home</NavLink></li>
                                    <li><NavLink to="/about">About Us</NavLink></li>
                                    <li><NavLink to="/overview">Overview</NavLink></li>
                                    <li><NavLink to="/demo">Get A Demo</NavLink></li>
                                    <li><NavLink to="/contact">Contact Us</NavLink></li>
                                    <li><a
                                        className="App-header-menu-link"
                                        href="https://ymponline.com/"
                                        target="_blank"
                                        rel="noopener noreferrer"
                                        >Signin</a>
                                    </li>
                                </ul> */}

                                <Navbar collapseOnSelect expand="lg" bg="dark" variant="dark">
                                    <Navbar.Brand href="/">
                                        <img src={logo} className="App-header-logo" alt="logo" />
                                        <span className="App-header-text">yacht maintenance program</span>
                                    </Navbar.Brand>
                                    <Navbar.Toggle aria-controls="responsive-navbar-nav" />
                                    <Navbar.Collapse id="responsive-navbar-nav">
                                        <Nav className="mr-auto">
                                            <Nav.Link href="/">Home</Nav.Link>
                                            <Nav.Link href="/about">About Us</Nav.Link>
                                            <Nav.Link href="/overview">Overview</Nav.Link>
                                            <Nav.Link href="/demo">Get A Demo</Nav.Link>
                                            <Nav.Link href="/contact">Contact Us</Nav.Link>
                                            <Nav.Link href="https://ymponline.com/">Signin</Nav.Link>
                                        </Nav>
                                    </Navbar.Collapse>
                                </Navbar>
                            </Col>
                        </Row>
                    </Container>
                </div>
                <div className="App-content">
                    <Container>
                        <Row>
                            <Col>
                                <Route exact path="/" component={Home} />
                                <Route path="/about" component={About} />
                                <Route path="/overview" component={Overview} />
                                <Route path="/demo" component={Demo} />
                                <Route path="/contact" component={Contact} />
                            </Col>
                        </Row>
                    </Container>
                </div>
            </BrowserRouter>
        );
    }
}

export default Header;
